function AirportCard ({ image, alt, title, price }) {
	return(

	<article className="swiper-slide w-[286px] h-[440px] rounded-xl overflow-hidden flex flex-col justify-between hover:cursor-pointer group transition-all duration-300">
      		<img src={image} alt={alt} className="rounded-xl" />
   	 <div className="card-text pt-6 font-bold">
        <h3 className=" text-[18px] leading-[28px] pb-[18px] text-navy transition-colors duration-300">
          {title}
        </h3>
        <p className="text-steel text-[16px] leading-[24px]">
          Airport Service Starting <br />
          from <span className="text-skyblue font-bold">{price}</span>
        </p>
      </div>
    </article>
	);
}
export default AirportCard;
